import React from 'react';
import { Typography, AppBar } from '@material-ui/core';
const App = () => {
    return(
        <div>
            <AppBar position="static" color="inherit">
                <Typography variant="h2" align="center">Video Chat</Typography>
            </AppBar>
            {/* videoplayer*/}
            {/* options -> notifications */}
        </div>
    );
}

export default App;
